import React from "react";
import Card from './Card';
import Sdata from "./Sdata";


function App() {
    return (
        <>
        <h1>Top Netflix Sugestion</h1>
            {
                Sdata.map((Sdata, index) => (
                    <Card
                        imgLink={Sdata.imgLink}
                        title={Sdata.title}
                        text={Sdata.text}
                        link_text={Sdata.link_text}
                        link={Sdata.link}
                    />
                ))
            }
        </>
    );
}
export default App;
